import React from 'react';

const ModSchedule = (props) => {
    return ( 
        <div>
            <h2>{props.modSelected.name}  {props.modSelected.nick_name}</h2>
            <ul>
            {props.letschedules.filter(schedule=>schedule.mod_id===props.modSelected.id)
                .map(sch=><li key={sch.id}>
                        {sch.date} <br/>
                            {sch.event} --
                            {sch.start_time} - {sch.end_time}
                            {sch.lecture_room_id}

                        </li>
            )}
            </ul>
        </div>
     );
}

export default ModSchedule;
